public class KeepersoftheHammer : QuestClass
{
	public KeepersoftheHammer()
	{
		Name = "Keepers of the Hammer";
		QuestId.Add(38907);
		Step.AddRange(new[] {1, 1});
	}
	public override bool IsComplete()
	{
		return ObjectManager.Me.Position.DistanceTo(NpcTurnIn.Position) < 200 && LegionQuests.InBrokenIsles;
	}
	public override bool Pulse()
	{
		if (ObjectManager.Me.PlayerUsingVehicle || ObjectManager.Me.IsOnTaxi)
			return true;

		if (LegionQuests.InDalaran)
		{
			var p = new Vector3(-863.934, 4298.434, 745.3467);
			if (GoToTask.ToPositionAndIntecractWithNpc(p, 96813, 1))
			{
				Thread.Sleep(Others.Random(1000, 2000));
				Lua.LuaDoString("TakeTaxiNode(7);");
			}
			return true;
		}
		GoToTask.ToPosition(NpcTurnIn.Position);
		return true;
	}
}

