public class FishOutofWater : QuestClass
{
	List<Vector3> _riverLocations = new List<Vector3>
	{
		new Vector3(4014.781f, 4763.972f, 619.4549f),
		new Vector3(4014.781f, 4763.972f, 619.4549f),
		new Vector3(4014.781f, 4763.972f, 619.4549f),
		new Vector3(3996.585f, 4834.041f, 620.6657f),
		new Vector3(3971.376f, 4895.486f, 619.5482f),
		new Vector3(3929.958f, 4968.265f, 621.6882f),
		new Vector3(3921.046f, 4910.024f, 620.1015f),
		new Vector3(3941.096f, 4835.551f, 619.4647f),
		new Vector3(3981.717f, 4775.756f, 621.3079f)
	};
	List<Vector3> _hotspots = new List<Vector3>()
	{
		new Vector3(4038.536, 4775.965, 623.6185),
		new Vector3(3985.755, 4902.08, 624.2513),
		new Vector3(3936.748, 4779.066, 625.9948),
		new Vector3(3936.509, 4943.055, 622.6791),
		new Vector3(3904.754, 5002.131, 627.1608),
	};
	WoWUnit _currentFish;

	public FishOutofWater()
	{
		Name = "Fish Out of Water";
		QuestId.Add(39614);
		Step.AddRange(new[] { 8 });
	}
	public override bool Pulse()
	{
		if (_currentFish == null || !_currentFish.IsValid || _currentFish.Position.Z < 620)
		{

			_currentFish = ObjectManager.GetObjectWoWUnit().Where(u => u.Entry == 95148 && u.Position.Z >= 620 && !wManager.wManagerSetting.IsBlackListed(u.Guid) && u.GetDistance < 60f)
				.OrderBy(u => u.GetDistance).FirstOrDefault();

			if (_currentFish == null)
			{
				var p0 = _hotspots[Others.Random(0, _hotspots.Count - 1)];
				GoToTask.ToPosition(p0);
				return true;
			}
		}

		var river = GetNearRiverPosition();
		var p = Questing.GetPositionFrom(_currentFish.Position, river, 3);

		if (GoToTask.ToPosition(p))
		{
			MovementManager.StopMove();
			MovementManager.Face(GetNearRiverPosition());
			Thread.Sleep(Others.Random(200, 400));
			Interact.InteractGameObject(_currentFish.GetBaseAddress);
			Thread.Sleep(Others.Random(1500, 2500));
			return true;
		}
		return true;
	}

	Vector3 GetNearRiverPosition()
	{
		return _riverLocations.OrderBy(v => v.DistanceTo(ObjectManager.Me.Position)).FirstOrDefault();
	}
}

