public class HatchlingsoftheTalon : QuestClass
{
	public HatchlingsoftheTalon()
	{
		Name = "Hatchlings of the Talon";
		QuestId.Add(41094);
		Step.AddRange(new[] { 6, 1 });
	}
	public override bool Pulse()
	{
		if (ObjectManager.Me.Position.Z > 365 && (ObjectManager.Me.HaveBuff(203740) || ObjectManager.Me.HaveBuff(203741)))
		{
			var globe = Globe();
			if (globe != null && globe.IsValid)
			{
				MovementManager.Face(globe);
				//Questing.ClickMove(globe.Position);
				Thread.Sleep(Others.Random(10, 20));
			}
			return true;
		}
		var p = new Vector3(3811.76, 5414.135, 631.6297);
		GoToTask.ToPositionAndIntecractWithNpc(p, 97925, 1);
		return true;
	}

	WoWUnit Globe()
	{
		WoWUnit globe = ObjectManager.GetObjectWoWUnit().Where(o => o.Entry == 103076 && o.Position.Z < ObjectManager.Me.Position.Z).OrderBy(o => o.GetDistance).FirstOrDefault();
		return globe;
	}

	public override bool IsComplete()
	{
		//if (ObjectManager.Me.HaveBuff(203740) || ObjectManager.Me.HaveBuff(203741))
		//	return false;

		return Questing.ObjectiveComplete(this, 2);
	}
}

