	{
		Name = "Moozy's Adventure";
		QuestId.Add(39572);
		Step.AddRange(new[] { 1, 0, 0, 0, 0 });
	}
	public override bool Pulse()
	{
		var p = new Vector3(3935.065, 5037.532, 621.8818, "None");
		GoToTask.ToPositionAndIntecractWithNpc(p, 95130);
		Quest.AcceptQuest();
		return true;
	}
	public override bool HasQuest()
	{
		return Questing.NotComplete(this);
	}
	public override bool IsComplete()
	{
