public class BalanceofElementsAndInvadingSpelunkersPickUp : QuestClass
{
	public BalanceofElementsAndInvadingSpelunkersPickUp()
	{
		Name = "Balance of Elements And Invading Spelunkers (Pick Up)";
		QuestId.Add(39488);
		QuestId.Add(39489);
		Step.AddRange(new[] { 0, 0, 0, 0, 0 });
	}
	public override bool Pulse()
	{
		var p = new Vector3(4067.304, 4971.247, 661.2092, "None");
		var npc = Questing.FindUnit(96038, 96520, 95973);
		if (npc != null && npc.IsValid)
		{
			Questing.PickUp(p, npc.Entry);
			return true;
		}
		GoToTask.ToPosition(p);
		return true;
	}
	public override bool IsComplete()
	{
		foreach (var questId in QuestId)
		{
			if (Quest.HasQuest(questId))
				continue;

			if (Quest.GetQuestCompleted(questId))
				continue;

			return false;
		}
		return true;
	}
	public override bool HasQuest()
	{
		return !IsComplete();
	}
}
